INSERT INTO `pdf_textos` (`id`, `descripcion`, `ubicacion`, `modulo`) VALUES
(1, '{\"titulo\":\"\",\"descripcion\":[\"El personal de bodega debe verificar que cuenta con la disponibilidad de las materias primas.\" ,\"Entregar las materias primas al personal de pesaje.\" ]}', 1, 2),
(2, '{\"titulo\":\"Nota\",\"descripcion\":[\"Los operarios de pesaje deben preparar y dispensar los colorantes y matizantes, en la cabina de extracción que se encuentra ubicada en el área de sólidos. Usar los elementos de protección personal adecuados y trasladar con precaución.\" ]}', 2, 2),
(3, '{\"titulo\":\"Limpieza y Desinfección\",\"descripcion\":[\"El limpión (Sacudidor) a utilizar deber ser de material que no genere desprendimiento de pelusa.\", \"Cada área cuenta con insumos de aseo independientes.\", \"El jabón para lavado debe ser de pH neutro.\" ]}', 3, 2),
(4, '{\"titulo\":\"\",\"descripcion\":[\"Pesar las materias primas de acuerdo a la fórmula y rotularlas con los sticker impresos.\", \"Proteger las materias primas para evitar contaminación.\", \"Ubicar las materias primas en el área de dispensación clasificadas por lote. \" ]}', 4, 2),
(5, '{\"titulo\":\"\",\"descripcion\":[\"Informar al personal de bodega de materias primas para que recoja los insumos.\", \"El director de producción informa la anulación del Batch record.\" ]}', 5, 2),
(6, '{\"titulo\":\"Limpieza y Desinfección\",\"descripcion\":[\"El limpión (Sacudidor) a utilizar deber ser de material que no genere desprendimiento de pelusa.\", \"Cada área cuenta con insumos de aseo independientes.\", \"El jabón para lavado debe ser de pH neutro.\" ]}', 6, 3),
(7, '{\"titulo\":\"\",\"descripcion\":[\"Tomar las materias primas de la zona de dispensación y llevarlas al área de preparación correspondiente.\", \"Elaborar el producto de acuerdo al paso a paso descrito en el Batch Record. \" ]}', 7, 3),
(8, '{\"titulo\":\"\",\"descripcion\":[\"La muestra se toma al finalizar el proceso de preparación cuando el producto se encuentre completamente homogéneo.\" ]}', 8, 3),
(9, '{\"titulo\":\"Observaciones\",\"descripcion\":[\"En caso de no cumplir algún parámetro de las especificaciones y si es necesario realizar ajustes en formulación, sólo se puede realizar con autorización de la Directora Técnica.\" ]}', 9, 3),
(10, '{\"titulo\":\"\",\"descripcion\":[\"Tapar adecuadamente la marmita o tanque, para que el producto no se contamine.\", \"Ubicar el tanque en la zona de almacenamiento y rotularlo con el formato: Producto terminado a granel F-Pr-12. \" ]}', 10, 3),
(11, '{\"titulo\":\"Toma de muestra \",\"descripcion\":[\"Tomar una muestra siguiendo el procedimiento Pr-CC-02 en el numeral 5.1.4\" ]}', 11, 4),
(12, '{\"titulo\":\"Limpieza y Desinfección\",\"descripcion\":[\"El limpión (Sacudidor) a utilizar deber ser de material que no genere desprendimiento de pelusa.\", \"Cada área cuenta con insumos de aseo independientes.\", \"El jabón para lavado debe ser de pH neutro.\" ]}', 12, 4),
(13, '{\"titulo\":\"\",\"descripcion\":[\"Realizar los análisis correspondientes según el tipo de producto.\" ]}', 13, 4),
(14, '{\"titulo\":\"Observaciones\",\"descripcion\":[\"En caso de rechazo, informar a la Directora Técnica para realizar los ajustes requeridos en formulación.\" ]}', 14, 4),
(15, '{\"titulo\":\"Limpieza y Desinfección\",\"descripcion\":[\"El limpión (Sacudidor) a utilizar deber ser de material que no genere desprendimiento de pelusa.\", \"Cada área cuenta con insumos de aseo independientes.\", \"El jabón para lavado debe ser de pH neutro.\" ]}', 15, 5),
(16, '{\"titulo\":\"Entrega de Material de Envase\",\"descripcion\":[\"El personal de bodega selecciona el material de envasado requerido para el proceso y lo ubica en la esclusa de cada área.\", \"El personal de envasado, recoge los insumos requeridoas y los lleva al área de envasado. \" ]}', 16, 5);
