INSERT INTO `preguntas` (`id`, `pregunta`) VALUES
(1, 'Se encuentran el área con materias primas, materiales, insumos y productos que no se requieren para la referencia y lote a fabricar?'),
(2, 'Están las áreas, equipos y herramientas necesarios para el proceso de pesaje limpios y desinfectados?'),
(3, 'Los recipientes para empacar las materias primas pesadas, se encuentran sucios y sin desinfectar?\r'),
(4, 'El personal que participará del proceso, porta el uniforme completo y limpio, de acuerdo con el instructivo i-sig-02?'),
(5, 'Están los procedimientos de pesaje, desinfección de áreas y equipos escritos y disponibles para consulta?'),
(6, 'Se encuentran el área con materias primas, materiales, insumos y productos que no se requieren para la referencia y lote a fabricar?'),
(7, 'Están las áreas, equipos y herramientas necesarios para el proceso de preparación limpios y desinfectados?'),
(8, 'El personal que participará del proceso, porta el uniforme incompleto y sucio, de acuerdo con el instructivo i-sig-02?'),
(9, 'Están los procedimientos escritos de preparación, desinfección de áreas y equipos corresponde al producto a elaborar?'),
(10, 'Verificar si las cantidades de las materias primas corresponden a la orden, si se encuentran limpias, aprobadas por control calidad y rotuladas?\r'),
(11, 'Los recipientes que se utilizaran para mezclar y preparar el producto a fabrica, se encuentran sucios y sin desinfectar?\r'),
(12, 'El agua (fría y/o caliente) a utilizar en la manufactura del producto, cumple con las especificaciones definidas?'),
(13, 'En el  área de preparación disponen del patrón estándar del producto a elaborar?'),
(14, 'Se encuentran el área con materiales, insumos y productos que no se requieren para la referencia y lote a fabricar?'),
(15, 'Están las áreas, equipos y herramientas necesarios para el proceso de envasado sucios y sin desinfectar?'),
